import React from "react";
import '../App.css'; 
const Form=()=>{
   return  (
   <form className="form-label">
    <h1 className='heading'>Signup</h1>
    <label for="name">Full Name</label><br/>
    <input type="text" className="fullname" placeholder="Full Name"/><br/>  
    <label for="email">Email</label><br/>
    <input type="email" className="email" placeholder="Email"/><br/>
    <label for="password">Password</label><br/>
    <input type="password" className="password" placeholder="Password"/><br/>
    <label for="confirm-password">Confirm Password</label><br/>
    <input type="password" className="confirm-password" placeholder="Confirm Password"/><br/>
    <p></p>
    <input type="button" value="Submit" id="btn"/>
    </form>
   )
}

export default Form;
